\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">If this happens you will not be able to see that offer.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\"><strong>Whom do I contact if I have any issues?</strong></p>\r\n<p>In the case of any problems, please feel free to get in touch with our support team who are more than willing to serve you by dropping an email at support@konsear.com</p>', '2014-07-15 07:32:30');
INSERT INTO `kon_pages` (`PageId`, `PageName`, `Description`, `LastUpdated`) VALUES
(3, 'Privacy Policy', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n </w:WordDocument>\r\n</xml><![endif]--></p>\r\n<p><!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState=\\\\\\\\\\\\\\"false\\\\\\\\\\\\\\" LatentStyleCount=\\\\\\\\\\\\\\"156\\\\\\\\\\\\\\">\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if !mso]><object\r\n classid=\\\\\\\\\\\\\\"clsid:38481807-CA0E-42D2-BF39-B33AF135CC4D\\\\\\\\\\\\\\" id=ieooui></object>\r\n<style>\r\nst1\\\\\\\\\\\\\\\\:*{behavior:url(#ieooui) }\r\n</style>\r\n<![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\\\\\\\\\\\\\\"Table Normal\\\\\\\\\\\\\\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-parent:\\\\\\\\\\\\\\"\\\\\\\\\\\\\\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\\\\\\\\\\\\\\"Times New Roman\\\\\\\\\\\\\\";\r\n	mso-ansi-language:#0400;\r\n	mso-fareast-language:#0400;\r\n	mso-bidi-language:#0400;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>Privacy Policy</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">In this privacy policy we will talk about the information that you provide to us and how we use it, if applicable.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>1. Personal Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Konsear collects information such as your name, valid e-mail address and password that you voluntarily submit in the process of creating or editing your account and user profile. Besides this, the following other information may be required or submitted by you or voluntarily or received by us from third parties such as:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">i. Delivery and shipping address;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">ii. Year of birth, gender and other demographic information;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">iii. Content like reviews, photos, ratings, comments, etc you post;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">iv. Your friends information from social networks;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">v. Billing and credit card details;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">vi. Personal Information about you from other sources i.e. our partner companies with whom you might have registered with.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>2. E-mails and Email IDs</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may use your email ID and emails in the following ways to:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">i. Collect your e-mail address and the full content of your e-mail, including attached files, and other information you provide;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">ii. Use and display your full name and e-mail address when you send an e-mail notification to a friend through Konsear;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">iii. Contact you on behalf of your friends (such as when someone sends you a personal message);</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">iv. Send you notifications of any offers we deem worthy which you can disable.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>3. IT Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">While using our mobile app or website, certain information is passively collected and stored such as:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">i. Your IP address;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">ii. Your Browser type;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">iii. Your OS;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">iv. Cookies: both session and persistent, and both of which can be cleared by you after every session;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">v. Your location information if it\\\\\\\\\\\\\\''s enabled on your mobile device;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">vi. Information to be sent when you are not logged into Konsear for alerts services, whose terms will be identified when you subscribe to or sign up for such services or applications.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>4. Social Media Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Certain information you post or provide through Konsear for public posting, such as your name, profile, comments, collections and reviews, may be shared with other users and posted on publicly available portions of Konsear, including without limitation, social media applications and other public forums in which you choose to participate.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Please bear in mind that if you choose to disclose Personal Information when posting comments or other information or content through Konsear , this information may become publicly available and may be collected and used by others, including people outside the Konsear community.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Please also be aware that if you choose to share or tweet Offers or your purchases, they will become publicly available on the Facebook and Twitter websites. It is up to you to make sure you are comfortable with the information you choose to provide us and the information you choose to publish. We will not have any obligations to screen, correct or withhold any information or content, with respect to any information that you post to parts of Konsear that is specifically available to others. Konsear recommends that you exercise caution when giving out personal information to others through any social media networks or otherwise.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">You may choose to log in or access Konsear using the Facebook Connect feature. By doing this, you are asking Facebook to send us certain information from your Facebook profile, and you authorize us to collect, store and use in accordance with this Privacy Policy any and all information available to us through the Facebook interface.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>5. Feedback Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">If you provide feedback to us, we may use and disclose such feedback for any purpose, provided we do not associate such feedback with your Personal Information. We will collect any information contained in such feedback and will treat the Personal Information in accordance with this Privacy Policy. You agree that any such comments and any e-mail we receive becomes our property. We may use feedback for marketing purposes or to add to or modify our services without paying any royalties or other compensation to you.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>6. Use and Disclosure of Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">In general, Personal Information and other information you submit or share with us is used for the following purposes by Konsear :</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">1. to enable your access to our services;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">2. to provide, maintain, protect, develop and improve Konsear ;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">3. to fulfill your requests for products and services;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">4. to customize the content and advertisements you receive from us and our trusted partners;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">5. to offer you additional information, opportunities, promotions and functionality from us or on our behalf, or from our partners or our advertisers at your request.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Except as otherwise stated in this Privacy Policy, we do not sell, trade, rent or otherwise share for marketing purposes the Personal Information that we collect with third parties, unless you ask or authorize us to do so.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may provide your Personal Information to third-party service providers or affiliates who work on behalf of or with us to provide some of the services and features of Konsear and to help us communicate with you.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Examples of such services include sending e-mail, analyzing data, providing marketing assistance, voucher management services, processing payments (including credit card payments) and providing customer service.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We limit information provided to the aforementioned affiliate and third party service providers to the extent necessary for them to provide the services and require such service providers to promise not to use such information except as necessary to provide the relevant services to us.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may share some or all of your Personal Information (other than credit card information) with Merchants whose Offers you have tagged for their commercial purposes and to provide the Offer . If you do not want us to use or disclose Personal Information collected about you in the manner identified in this Privacy Policy, you may not use Konsear.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Certain Offers may expressly require you to submit information for fulfillment at the point of purchase, and Merchants may separately request information from you as necessary to redeem the Voucher you have purchased, or for their own purposes. A merchant&rsquo;s collection and use of any information shall be governed by that Merchant&rsquo;s own privacy policy. Additionally, we do share your content preferences and other information with social networks you have connected with Konsear, along with those companies and persons you have asked us to share your information with.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may share some or all of your Personal Information with Konsear affiliated and group of companies that are under a common control, so that they may send information to you, in which case we will require them to honor this Privacy Policy.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We use Google Analytics and the services of a private contractor, other technologies, to better understand how visitors interact with our site. This service provides non-personally identifiable data including but not limited to data on where visitors came from, what actions they took on our site and where visitors went when they left our site.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may also develop non-personal information concerning Konsear users, using de-identification processes to help ensure that such information cannot reasonably be re-associated or connected with you as an individual. Generally, we aggregate this information and use it in statistical analysis to help us analyze patterns in the use of Konsear. This Privacy Policy does not limit our use or disclosure of de-identified information (i.e., that is not connected with you as a user) in any way, and we reserve the right to use and disclose such information to our partners, advertisers and other third parties in our discretion.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">In the event we go through a business transition such as a merger, acquisition by another company or sale of all or a portion of our assets, your Personal Information may be among the assets transferred. You acknowledge that such transfers may occur and are permitted by this Privacy Policy, and that any acquirer of ours or that acquirer&rsquo;s assets may continue to process your Personal Information as set forth in this Privacy Policy.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may disclose your Personal Information if we believe in good faith that such disclosure is necessary to (a) comply with relevant laws or to respond to subpoenas or warrants served on us; or (b) to protect and defend our rights or property, you, or third parties. You hereby consent to us sharing your Personal Information under the circumstances described herein.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>7.</strong> <strong>Your Choices Regarding Your Personal Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We offer you choices regarding the collection, use and sharing of your Personal Information. You have a right at any time to stop us from contacting you for marketing purposes. When you receive promotional communications from us, you may indicate a preference to stop receiving further promotional communications from us and you will have the opportunity to &ldquo;opt-out&rdquo; by following the unsubscribe instructions provided in any promotional e-mail you receive or by contacting us directly at support@Konsear.com.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Despite your indicated e-mail marketing preferences, we may send you administrative e-mails regarding Konsear, including, for example, administrative and transactional confirmations, and notices of updates to our Privacy Policy if we choose to provide such notices to you in this manner.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">If you use Konsear services provided through mobile devices, you may have additional choices, including over whether location services are enabled. Additionally, if you use other social media services in connection with Konsear, the providers of these services may provide you with additional choices concerning the types of data shared with Konsear.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>8. Third Party Advertising and Sites</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We may enable advertisers and ad servers to promote third-party products and/or services by placing advertisements on Konsear .These advertisers and ad servers may use Cookies, &ldquo;Web Beacons&rdquo; (which are usually small, transparent graphic images) or similar technologies in order to monitor information related to the serving of their advertisements, and may use information gathered over time and across Web sites in order to make the ads you receive more relevant. Clicking on such advertisements will direct you to the website of a third-party and the advertiser.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We also engage in remarketing to market our sites, products and services or those of our trusted advertising partners across the web: when a user visits our site, a Cookie is dropped on the user, and advertising networks may deliver targeted advertisements to users with this Cookie. We do not share any of your Personal Information with our remarketing ad networks or advertisers.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">You have choices about third-party advertising: both the Network Advertising Initiative and the Digital Advertising Alliance allow you to opt out from online behavioral advertising by their participating companies.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Konsear may contain links to other websites or may make third-party applications available to our users.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Please be aware that we are not responsible for the privacy practices or the content of such other websites or applications. We encourage our users to read the privacy statements of each and every website they visit or application they use.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">This Privacy Policy applies solely to information collected by us through Konsear and does not apply to these third-party websites or applications. The ability to access information of third parties from Konsear, or links to other websites or locations, is for your convenience and does not signify our endorsement of such third parties, their products, their services, other websites, locations or their content.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>9. Security</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">We are committed to protecting the security of your Personal Information. We use a variety of industry-standard security technologies and procedures to help protect your Personal Information from unauthorized access, use or disclosure. Even though we have taken significant steps to protect your Personal Information, no company, including us, can fully eliminate security risks associated with Personal Information.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>10. Access to Personal Information</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">You have the right to request a copy of the Personal Information that we hold about you. If you would like a copy of some or all of your Personal Information, please contact us at support@konsear.com</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>11. Enforcement</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Personal or other information about you collected on Konsear may be stored and processed in the United States or any other country in which Konsear or its affiliates, subsidiaries and services providers maintain facilities.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\"><strong>How to Contact Us</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">If you have questions or concerns about our Privacy Policy, please contact us at: support@konsear.com</p>', '2014-07-15 07:36:05');
INSERT INTO `kon_pages` (`PageId`, `PageName`, `Description`, `LastUpdated`) VALUES
(4, 'Terms and Conditions', '<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\"><strong>Konsear Terms &amp; Conditions of Use</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>PLEASE READ THESE TERMS CAREFULLY BEFORE USING OUR WEBSITE OR SERVICES. </strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>Welcome to Konsear.com!</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>By using this website or any related mobile application (app or apps), you are agreeingï¿½ to comply with and be bound by the following terms and conditions of use, which together with our Privacy Policy governs the relationship between you and Evaltech, Inc.(Konsear is a Service of Evaltech, Inc.), owner and provider of the app and website. The terms Provider or us or we or our refer to the owner of the app and website, whose registered office is 1000 Lafayette Blvd, Suite 1100, Bridgeport, CT 06604. The terms you or your refers to any user or viewer of the app or website. The words terms,conditions, or agreement refer to these Terms and Conditions of Use. The term services means any services or products provided by us, our app or our website.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Konsear provides its services subject to the following terms and conditions. Your acceptance of these conditions is required for you to use the app and/or website. Please read this document carefully, because it includes, without limitation, important disclosures and vital information regarding terms of use, sale, and other terms that may affect your legal rights.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>1. Your Acceptance</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>The terms constitute a binding legal agreement in electronic form between you and Evaltech, Inc. They also govern your use of the website and/or apps offered by Konsear at Konsear.com (including any mobile, web, merchant-specific, city-specific or other area-specific versions or sections), and all products or services accessed through the use of Konsear.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>The terms also include:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>i. Conditions of use;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>ii. Privacy Policy and any supplemental terms;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iii. Legal notices and other communications.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>If you do not agree to these terms, please stop accessing or using any of our services immediately. By using Konsear, you have accepted all the terms.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>2. Electronic Communication</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>You agree to receive communications from Konsear in an electronic form and that all terms and conditions, agreements, notices, disclosures and other communications that we provide to you electronically satisfy any legal requirement that such communications would satisfy if they were in writing.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>3. Privacy Policy</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Your privacy is very important to us and so we have designed our Privacy Policy to make important disclosures about how we collect, use and protect your personal data. We implore you to read the Privacy Policy to help make informed decisions while using Konsear. You may access the Privacy Policy by using this link: <a href=\\"\\\\&quot;http:/www.konsear.com/privacy_policy.php\\\\&quot;\\">http://www.konsear.com/privacy_policy.php</a></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>4. Conditions of Use</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>You are permitted to use the Konsear website and/or app if you fulfil the following conditions:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>i. You are at least 21 years old;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>ii. You will comply with these terms;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iii. You are able to form a binding contract with us;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iv. You are not prohibited by law from accessing Konsear or have not previously been banned, terminated or otherwise denied access to the website or app by us;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>v. You are not acting on behalf of a person whose access to our services has been previously terminated or otherwise denied by us;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>vi. You will not be impersonating another Konsear user.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>5. Account</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>You are required to register by creating an account with Konsear, either by registering directly with us or by allowing a Konsear application to connect through your Facebook or LinkedIn profile, in order to obtain access to our services. You agree to provide only accurate, complete registration information, and you will keep, maintain and update that information as and when it might change. When you register, you can choose a unique username and password. Access to Konsear will not be authorized by any other person or entity using your username and you alone are responsible for preventing such unauthorized use. Also, you are solely responsible for any and all access to Konsear by anyone using your username. If you believe your account has been compromised in any way, please notify us immediately.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>6. Ownership of Our Content</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>The app and website services, including past, present and future versions, and all content that are included in, on or that are otherwise a part of the all content, are owned, controlled or licensed by Evaltech, Inc. None of our content may be copied, modified, reproduced, downloaded or distributed in any way, in whole or in part, without the express prior written permission of Evaltech, Inc., unless and except as is expressly provided in these terms.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>7. Copyright</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>All content under Evaltech, Inc. is copyrighted under the United States copyright laws and/or similar laws of other jurisdictions. Without limitation, Evaltech, Inc. owns a copyright in the selection, coordination, arrangement and enhancement of their original content. You agree to abide by any and all additional copyright notices, information or restrictions.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>8. Trademark</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Trademarks and service marks, including, without limitation, the brand \\\\\\"Konsear\\\\\\", are trademarks of Evaltech, Inc. You agree not to display or use, in any manner, any such marks without Evaltech\\\\\\''s prior written permission. Without limitation of the preceding, you may not use any Meta tags using our names or trademarks without our expressly written consent. You agree to abide by any and all additional trademark notifications, information or restrictions.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>9. Access to Konsear</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Subject to your compliance with the terms, we grant you a limited license to access our services for your personal use. You are expressly prohibited from engaging in any of the following activities:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>i. Resale or commercial use of our offers and content or materials found in the app or on the website;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>ii. Collection and use of any product listings, descriptions or prices other than your own personal use, including, without limitation, any purpose competitive to Konsear, such as, and without limitation, commercial uses or marketing.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iii. Downloads or copying of website or account information for any reason apart from personal use, or any use of data mining, robots or similar data gathering and extraction tools;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iv. Deep-linking to any portion of the website and app;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>v. Framing or utilizing framing techniques to enclose or include any portion of the Konsear app or website in another web page or other medium without our written consent;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>vi. Access or collect any personally identifiable information, including account names, email addresses or other such information for any purpose, including, without limitation, commercial purposes;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>vii. Attempting to gain access to secured portions of our services to which you do not possess access rights;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>viii. Generation of unsolicited email advertisements or spam;</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>ix. Search of information or interfering in any way with the proper functioning of our services.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Any unauthorized use found thereon shall immediately call for termination of the permission or license granted by us in these terms. You are granted a limited, revocable and nonexclusive right to create a hyperlink to the home page of Konsear.com so long as the link does not portray us or any of our products or services in a false, misleading, or offensive way. However, you may not use any of our logos or trademarks as part of the link without our permission.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>10. Third-Party Links and Content</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Konsear, or communications sent to you by Konsear, may include third-party content or links to third-party websites that we do not control, maintain or endorse. We do not control those third-party sites or any of the content contained therein and you expressly acknowledge and agree that we are in no way responsible or liable for any of those third-party sites, including, without limitation, their content, policies, failures, promotions, products, services, actions and/or any damages, losses, failures or problems caused by, related to or arising from those third parties or their sites.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>YOUR CORRESPONDENCE AND BUSINESS OFFERINGS WITH OTHERS FOUND ON OR THROUGH THE APP OR ANY OF OUR WEBSITES AND/OR SERVICES, INCLUDING, WITHOUT LIMITATION, THE PAYMENT AND DELIVERY OF PRODUCTS AND SERVICES, AND ANY TERMS, CONDITIONS, WARRANTIES AND REPRESENTATIONS ASSOCIATED WITH ANY SUCH OFFERINGS, ARE SOLELY BETWEEN YOU AND THE THIRD-PARTY. KONSEAR ADVISES THAT YOU REVIEW ALL POLICIES, RULES, TERMS AND REGULATIONS, INCLUDING THE PRIVACY POLICIES AND TERMS OF USE OF EACH AND EVERY THIRD-PARTY SITE THAT YOU MAY VISIT.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>11. User Content</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Konsear gives you the opportunity to post reviews, comments, photos, questions and other content on the app and website. You are required to abide by the following conditions when posting anything on through the app or on the website:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>i. You agree not to post content that is illegal, obscene, threatening, defamatory, and invasive of privacy, infringing of intellectual property rights or otherwise injurious to third parties.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>ii. You agree not to post content that contains software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any form of spam.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iii. You may not use a false e-mail address or impersonate any person or entity or otherwise mislead as to the origin of User Content. Konsear reserves the right (but not the obligation) to remove or edit such User Content, but does not regularly review the content.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>iv. By submitting aforementioned type of content, you give Konsear a non-exclusive, royalty-free, perpetual, irrevocable and fully sub-licensable right to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute and for display. You grant us the right to use the name that you submit in connection with such User Content at our discretion.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>v. You represent and warrant that you own or otherwise control all of the rights to the User Content that you post and that the content is accurate. You agree to indemnify Konsear for all claims resulting from User Content that you submit as Konsear takes no responsibility and assumes no liability for your submissions.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>vi. You agree that Konsear may, but is not required to, remove content that you post, without notice to you, if we determine, in our sole discretion, that it violates any of the terms and conditions of use for the app and/or the website.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>12. Product or Offer Submissions/Publications</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>Konsear will not accept unsolicited submissions for business ideas, web sites, articles or other products or services. We intend to avoid the possibility of future issues when projects developed by Konsear might appear to be similar to their own creative ideas. Please refrain from making unsolicited submissions to Konsear. Although, if you decide to make any such unsolicited submissions, you will grant Konsear irrevocable rights and license to the submission as if it were User Content (please see above).</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>If you, or any of your business associates or affiliates, are publishing an offer related to consumption of an Alcohol, including, but not limited to, Wine Tasting, Happy Hour, etc. you and your business will be solely responsible for abiding by the laws of the jurisdiction governing the sale, use and consumption of alcohol wherever you are doing business.</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>ï¿½It is important for you to review the law of the jurisdiction where you are doing business. We provide the following link for your review as a guide and for your information and education ONLY, and without providing legal or other professional advice of any kind:</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><a href=\\"\\\\&quot;http:/www.udetc.org/documents/HappyHoursDrinkSpecialsPolicies.pdf\\\\&quot;\\">http://www.udetc.org/documents/HappyHoursDrinkSpecialsPolicies.pdf</a></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>You are hereby advised and agree to consult with the appropriate professional before taking any action that would require professional advice.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>If you are not legally able to accept these terms, or refuse to abide by and comply with this agreement and the law of your jurisdiction, you must cease use of the app, website and/or any other services immediately and agree not to publish any offer<ins cite=\\"\\\\&quot;mailto:KMMillerJD\\\\&quot;\\" datetime=\\"\\\\&quot;2015-04-28T11:59\\\\&quot;\\">.</ins> You agree that Konsear may, but is not required to, remove any offer or other content that you post, without notice to you, if we determine, in our sole discretion, that it violates the laws of any jurisdiction.</p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p><strong>13. Agreement Termination</strong></p>\r\n<p class=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;MsoNormal\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">&nbsp;</p>\r\n<p>If for any reason, you want to terminate your legal agreement with Konsear, you may do so by notifying Konsear and deleting your accou