(335, 113, 118, 6, 10, 433, 'Let your event shine', 'Connecticut Jazz Events provides jazz bands that are ideal for weddings, corporate events as well as private and social events of all types.', '', '', '', '2015-12-07 00:00:00', '2015-12-31 00:00:00', 'Connecticut Jazz Events provides jazz bands that are ideal for weddings, corporate events as well as private and social events of all types.', 'Yes', 'Inactive', 'uploads/offers/335/thumb.png', 4),
(336, 113, 118, 6, 10, 433, 'Let your event shine', 'Connecticut Jazz Events provides jazz bands that are ideal for weddings, corporate events as well as private and social events of all types. Visit http://www.ConnecticutJazzEvents.com for more info about hiring a band for your special event!', '', '', '', '2015-12-08 00:00:00', '2016-01-07 00:00:00', 'Connecticut Jazz Events provides jazz bands that are ideal for weddings, corporate events as well as private and social events of all types.', 'Yes', 'Active', 'uploads/offers/335/thumb.png', 26),
(337, 114, 119, 6, 1, 66, 'Book Your Private Party', 'Arno Ristorante offers several private dining rooms from 10-200 for corporate breakfasts, lunch and dinners. Meetings, pretheater parties, weddings and other special occasions are also perfect at Arno. Inquire about our great team building events including our legendary Iron Chef Competition for your next corporate event. In addition, the entire restaurant can be reserved for up to 400 guests.', '', '', '', '2015-12-07 00:00:00', '2016-12-20 00:00:00', 'Nestled between the theater and garment districts,  Arno Ristorante offers Northern Italian cuisine in a traditional, upscale setting for over 20 years. Just steps from Madison Square Garden and Broadway theaters, you and your guests can enjoy a delicious meal before or after the event.\r\n ', 'Yes', 'Active', 'uploads/offers/337/thumb.png', 79),
(338, 115, 120, 3, 20, 611, 'Sunday Funday Football at The Shannon!', 'Sunday Shanigans at The Shannon is better than ever! Join us for NFL Sunday Funday every week!\r\nWe have the BEST specials in town + the Largest menu in Hoboken! Thatâ€™s right, bring your own food or order in!\r\n\r\n$3 Pints, $5 Personal Pitchers, $11 Pitchers, $5 Jameson & Fireball, $7 Devotion Vodka Doubles, $15 & $18 Buckets\r\n\r\nFREE WiFi to keep track of your fantasy leagues (Or your friendâ€™s facebook & instagram posts)\r\n\r\nReserve your table today! Email theshannonhoboken@gmail.com to reserve ', '', '', '', '2015-12-08 00:00:00', '2016-12-07 00:00:00', 'Hoboken residents get to skip the line!\r\nYou live here and we want you to party with us!\r\n\r\nWe know our line is sometimes long and you donâ€™t want to wait.\r\n\r\nWe donâ€™t think you should wait in line!\r\n\r\nBring your Hoboken ID right up to the front of the line and we will let you in as soon as possible!', 'Yes', 'Active', 'uploads/offers/338/thumb.png', 52),
